INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (27, "人助けが大好き！　前向き格闘娘", 0, 2, 44, "東山奈央", 155, 8, 16, "ヒヨリ", "獣人族", 100101, "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A", "人助け、応援");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, "戦闘のサポートが得意な、心優しい少女", 0, 2, 47, "種田梨沙", 158, 4, 17, "ユイ", "ヒューマン", 100201, "トゥインクルウィッシュ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "O", "料理、人間観察");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, "クールで何事にも真っ直ぐな剣士", 0, 2, 46, "早見沙織", 163, 1, 18, "レイ", "魔族", 100301, "トゥインクルウィッシュ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "B", "読書、乗馬、お茶");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, "探検好きのイタズラっ子", 0, 5, 27, "諸星すみれ", 128, 8, 9, "ミソギ", "ヒューマン", 100401, "リトルリリカル", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "O", "いたずら、探検");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (25, "ヒーローに憧れる騎士見習いの少女", 0, 8, 40, "下田麻美", 146, 11, 12, "マツリ", "獣人族", 100501, "王宮騎士団（NIGHTMARE）", "？？？", "O", "ヒーローごっこ");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (22, "甘え上手なみんなの人気者", 0, 7, 42, "浅倉杏美", 150, 11, 13, "アカリ", "魔族", 100601, "悪魔偽王国軍（ディアボロス）", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "O", "サックス");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (23, "プリン大好きゴースト娘", 0, 7, 32, "雨宮天", 130, 1, 14, "ミヤコ", "魔族", 100701, "悪魔偽王国軍（ディアボロス）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "B", "プリンを食べること");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, "ボクは誰よりも美しい", 0, 15, 40, "大空直美", 150, 10, 14, "ユキ", "エルフ", 100801, "ヴァイスフリューゲル　ランドソル支部", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "AB", "鏡で自分を見ること");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, "前世を信じる中二病患者、「疾風の冥姫」", 0, 13, 45, "髙野麻美", 159, 7, 17, "アンナ", "魔族", 100901, "トワイライトキャラバン", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "A", "小説執筆");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (22, "マホマホ王国のプリンセス", 0, 10, 42, "内田真礼", 155, 9, 16, "マホ", "獣人族", 101001, "自警団（カォン）", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "O", "空想、ぬいぐるみ集め");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (25, "人懐っこくてマシンガントークな妹系少女", 0, 3, 44, "阿澄佳奈", 156, 8, 15, "リノ", "ヒューマン", 101101, "ラビリンス", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "A", "お裁縫");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (24, "みんなのために超能力を使う眠り姫", 0, 6, 46, "大橋彩香", 156, 12, 17, "ハツネ", "エルフ", 101201, "フォレスティエ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "A", "妹と遊ぶこと、二度寝、昼寝、早寝");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (21, "オタク全開な魔法少女", 0, 13, 55, "佳村はるか", 166, 8, 18, "ナナカ", "魔族", 101301, "トワイライトキャラバン", "", "O", "読書、魔法");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "頭脳明晰な美少女名探偵", 0, 10, 41, "水瀬いのり", 152, 11, 15, "カスミ", "獣人族", 101401, "自警団（カォン）", "test", "AB", "読書、推理");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, "母性溢れる優しいみんなの「ミサト先生」", 0, 6, 54, "國府田マリ子", 165, 9, 21, "ミサト", "エルフ", 101501, "フォレスティエ", "test", "O", "絵本作り");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, "天真爛漫で人気者のカリスマモデル", 0, 14, 48, "上坂すみれ", 167, 4, 18, "スズナ", "魔族", 101601, "ルーセント学院", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "O", "ファッション");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, "いつでも「なんくるないさ～」な天然娘", 0, 10, 53, "高森奈津美", 158, 7, 19, "カオリ", "獣人族", 101701, "自警団（カォン）", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "A", "踊り、空手");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (14, "多くの男性を魅了する無垢な女教師", 0, 14, 52, "伊藤静", 162, 8, 23, "イオ", "魔族", 101801, "ルーセント学院", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "B", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "お歌もにんじんも、ウサギさんも大好き♪", 0, 5, 21, "日高里菜", 117, 4, 10, "ミミ", "獣人族", 102001, "リトルリリカル", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "O", "かわいいもの集め");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, "泣き虫で臆病な守ってあげたい女の子", 0, 9, 40, "植田佳奈", 150, 6, 12, "クルミ", "ヒューマン", 102101, "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B", "観劇、おままごと");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (22, "人見知りであまのじゃくな女の子", 0, 7, 40, "原紗友里", 150, 11, 13, "ヨリ", "魔族", 102201, "悪魔偽王国軍（ディアボロス）", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "O", "ゲーム全般");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, "ぷうきちといつも一緒！", 0, 9, 38, "芹澤優", 148, 5, 14, "アヤネ", "ヒューマン", 102301, "サレンディア救護院", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "B", "屋内でできる遊び");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, "お嬢さまのためにがんばるドジっ娘メイド", 0, 9, 43, "悠木碧", 154, 12, 15, "スズメ", "ヒューマン", 102501, "サレンディア救護院", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "O", "ご奉仕");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, "遊びと睡眠が何より大事なぐうたら娘", 0, 11, 42, "小岩井ことり", 144, 1, 17, "リン", "獣人族", 102601, "牧場（エリザベスパーク）", "test", "B", "あんパン");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (30, "運命の相手に一途すぎる乙女", 0, 13, 43, "橋本ちなみ", 154, 7, 16, "エリコ", "魔族", 102701, "トワイライトキャラバン", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "B", "実験、裁縫、料理");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, "救護院を経営する優しい庶民派お嬢様", 0, 9, 43, "堀江由衣", 156, 10, 17, "サレン", "エルフ", 102801, "サレンディア救護院", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "A", "経営、お茶会");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (24, "歌って踊れる大人気アイドル", 0, 4, 40, "日笠陽子", 157, 1, 17, "ノゾミ", "ヒューマン", 102901, "カルミナ", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "B", "舞台鑑賞、ダンス");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (31, "トーゴクの神秘、オシエテクダサイ！", 0, 15, 51, "佐藤聡美", 163, 8, 16, "ニノン", "ヒューマン", 103001, "ヴァイスフリューゲル　ランドソル支部", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "O", "忍法開発");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (22, "占いが得意な霊能少女", 0, 7, 42, "大坪由佳", 157, 12, 18, "シノブ", "魔族", 103101, "悪魔偽王国軍（ディアボロス）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "AB", "占い");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, "一人前の商人を目指すパワフルお嬢様", 0, 12, 45, "松嵜麗", 157, 3, 18, "アキノ", "ヒューマン", 103201, "メルクリウス財団", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "AB", "慈善事業");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "みんなを笑顔にするお笑い牧場主", 0, 11, 35, "新田恵海", 142, 3, 20, "マヒル", "ヒューマン", 103301, "牧場（エリザベスパーク）", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "B", "漫才");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (16, "純情でほっとけない大人の女性", 0, 12, 55, "今井麻美", 164, 3, 22, "ユカリ", "エルフ", 103401, "メルクリウス財団", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "A", "ウインドーショッピング");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (2, "礼儀正しくしっかり者のちびっ子優等生", 0, 5, 21, "小倉唯", 118, 2, 8, "キョウカ", "エルフ", 103601, "リトルリリカル", "test", "A", "お勉強");
