INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "読書が趣味の病弱少女", 0, 11, 40, "小清水亜美", 153, 11, 14, "シオリ", "獣人族", 103801, "牧場（エリザベスパーク）", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "A", "読書、お散歩");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, "「友達」に憧れる、エルフの森の女の子", 0, 6, 44, "花澤香菜", 158, 6, 13, "アオイ", "エルフ", 104001, "フォレスティエ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "AB", "友達作りのイメトレ");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "人々を守るために歌う、唱喚士の少女", 0, 4, 46, "福原綾香", 163, 6, 17, "チカ", "ヒューマン", 104201, "カルミナ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O", "各種楽器");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, "男勝りで情に厚いワイルド娘", 0, 10, 54, "小松未可子", 168, 8, 17, "マコト", "獣人族", 104301, "自警団（カォン）", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "O", "お菓子作り");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, "かつては夜を支配した最強の吸血鬼", 0, 7, 50, "丹下桜", 172, 5, "??", "イリヤ", "魔族", 104401, "悪魔偽王国軍（ディアボロス）", "test", "A", "世界征服");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (19, "妄想大好き！　ほんとは照れ屋な女の子", 0, 15, 49, "長妻樹里", 157, 11, 18, "クウカ", "ヒューマン", 104501, "ヴァイスフリューゲル　ランドソル支部", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "AB", "小説を読むこと");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, "弱きを助け強きをくじく猫娘", 0, 12, 48, "沼倉愛美", 158, 3, 18, "タマキ", "獣人族", 104601, "メルクリウス財団", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "AB", "猫とたわむれること");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (25, "素顔を見せない冷静沈着な女性騎士", 0, 8, 50, "川澄綾子", 171, 10, 25, "ジュン", "ヒューマン", 104701, "王宮騎士団（NIGHTMARE）", "？？？", "A", "格闘技、湯浴み");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, "仕事も私事も効率優先な傭兵少女", 0, 12, 49, "田所あずさ", 163, 11, 20, "ミフユ", "ヒューマン", 104801, "メルクリウス財団", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "O", "傭兵などのアルバイト");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (24, "お姉ちゃんがお世話してあげるからねっ！", 0, 3, 54, "生天目仁美", 168, 10, 18, "シズル", "ヒューマン", 104901, "ラビリンス", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "O", "家事全般");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "ちょっとおませな恋に恋する女の子", 0, 14, 22, "久野美咲", 120, 1, 11, "ミサキ", "魔族", 105001, "ルーセント学院", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "A", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, "実験が趣味の危険な科学者", 0, 13, 53, "三石琴乃", 166, 3, 27, "ミツキ", "ヒューマン", 105101, "トワイライトキャラバン", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "A", "研究、実験");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (14, "乙女チックなもふもふアニマル", 0, 11, 100, "徳井青空", 150, 3, 18, "リマ", "獣人族", 105201, "牧場（エリザベスパーク）", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "A", "毛繕い、お喋り");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (28, "見た目も中身もお子ちゃまな異国の軍人", 0, 15, 33, "辻あゆみ", 140, 7, 18, "モニカ", "ヒューマン", 105301, "ヴァイスフリューゲル　ランドソル支部", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "A", "お菓子屋通い");
