INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (1, "弱きを助け強きをくじく猫娘", 0, 12, 48, "沼倉愛美", 158, 3, 18, "タマキ（サマー）", "獣人族", 107901, "メルクリウス財団", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "AB", "猫とたわむれること");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, "仕事も私事も効率優先な傭兵少女", 0, 12, 49, "田所あずさ", 163, 11, 20, "ミフユ（サマー）", "ヒューマン", 108001, "メルクリウス財団", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "O", "傭兵などのアルバイト");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (22, "占いが得意な霊能少女", 0, 7, 42, "大坪由佳", 157, 12, 18, "シノブ（ハロウィン）", "魔族", 108101, "悪魔偽王国軍（ディアボロス）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "AB", "占い");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (23, "プリン大好きゴースト娘", 0, 7, 32, "雨宮天", 130, 1, 14, "ミヤコ（ハロウィン）", "魔族", 108201, "悪魔偽王国軍（ディアボロス）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "B", "プリンを食べること");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "ちょっとおませな恋に恋する女の子", 0, 14, 22, "久野美咲", 120, 1, 11, "ミサキ（ハロウィン）", "魔族", 108301, "ルーセント学院", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "A", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "人々を守るために歌う、唱喚士の少女", 0, 4, 46, "福原綾香", 163, 6, 17, "チカ（クリスマス）", "ヒューマン", 108401, "カルミナ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O", "各種楽器");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, "泣き虫で臆病な守ってあげたい女の子", 0, 9, 40, "植田佳奈", 150, 6, 12, "クルミ（クリスマス）", "ヒューマン", 108501, "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B", "観劇、おままごと");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, "ぷうきちといつも一緒！", 0, 9, 38, "芹澤優", 148, 5, 14, "アヤネ（クリスマス）", "ヒューマン", 108601, "サレンディア救護院", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "B", "屋内でできる遊び");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (27, "人助けが大好き！　前向き格闘娘", 0, 2, 44, "東山奈央", 155, 8, 16, "ヒヨリ（ニューイヤー）", "獣人族", 108701, "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A", "人助け、応援");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, "戦闘のサポートが得意な、心優しい少女", 0, 2, 47, "種田梨沙", 158, 4, 17, "ユイ（ニューイヤー）", "ヒューマン", 108801, "トゥインクルウィッシュ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "O", "料理、人間観察");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, "クールで何事にも真っ直ぐな剣士", 0, 2, 46, "早見沙織", 163, 1, 18, "レイ（ニューイヤー）", "魔族", 108901, "トゥインクルウィッシュ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "B", "読書、乗馬、お茶");
