INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, "人を超越した力を有す心優しい竜姫", 0, "", 67, "福原綾香", 167, 11, 17, "グレア", "半人半竜", 109401, "？？？", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "B", "ピアノ");
